import React from 'react'
import Todo from './Todo'

const todos = [
  {"descrition": "Einkaufen", "done": true},
  {"descrition": "Sport", "done": false},
  {"descrition": "Lernen", "done": false},
  {"descrition": "Entspannen", "done": false}
];

const TodoList = () => {
  return (
    <>
      <div>Todo List</div>
      <Todo description={todos[0].descrition} done={todos[0].done}></Todo>
      <Todo description={todos[1].descrition} done={todos[1].done}></Todo>
      <Todo description={todos[2].descrition} done={todos[2].done}></Todo>
      <Todo description={todos[3].descrition} done={todos[3].done}></Todo>
    </>
  )
}

export default TodoList
